window.bookSummaryJSON = "<p><b>There are enemies everywhere…but none as deadly as the one lurking inside me.</b></p> <p>Vampire gangs, Lucifer rising, hellhounds on the loose, and an unruly shadow creature hell-bent on taking control…and no, that’s not the beginning of a bad joke. It’s a nightmare.</p> <p>And it’s my life.</p> <p>To get to Hell and stop the coming war, we need to find the last three relics and open the gates. But the greatest threat isn’t Lucifer. It’s the creature who shares my soul.</p> <p>Hell will freeze over before my demons let me go, but with Sayah’s powers and influence growing, I’m not sure anyone can stop my greatest fear from coming true.</p> <p>I’m losing myself to the darkness.</p> <p>And scariest of all…I like it. </p> <p><i>One-click to travel deeper into the underworld today!</i></p> <p><b><i>When Hell Freezes Over</i></b><b> is book five in the Sin Demons Series.</b></p>"; 
